"use strict";(self.webpackChunkarchive_dernier_verre=self.webpackChunkarchive_dernier_verre||[]).push([[87670],{86138:(e,n,r)=>{r.r(n),r.d(n,{assets:()=>u,contentTitle:()=>s,default:()=>d,frontMatter:()=>t,metadata:()=>l,toc:()=>o});var a=r(74848),i=r(28453);const t={title:"2022-12-31 - Table (Feyre, Nathan)",toc_min_heading_level:4,toc_max_heading_level:4,tags:["tag_FeyreArtcher","tag_Nathan"]},s="Table (Feyre, Nathan)",l={id:"Archives/Events/ReceptionFinAnnee2022/Table2_Feyre_Nathan",title:"2022-12-31 - Table (Feyre, Nathan)",description:"Table - 31/12/2022",source:"@site/docs/Archives/Events/ReceptionFinAnnee2022/Table2_Feyre_Nathan.mdx",sourceDirName:"Archives/Events/ReceptionFinAnnee2022",slug:"/Archives/Events/ReceptionFinAnnee2022/Table2_Feyre_Nathan",permalink:"/ArchiveLeDernierVerre/docs/Archives/Events/ReceptionFinAnnee2022/Table2_Feyre_Nathan",draft:!1,unlisted:!1,tags:[{inline:!1,label:"Feyre Artcher",permalink:"/ArchiveLeDernierVerre/docs/tags/FeyreArtcher",description:"Archives o\xf9 Feyre Artcher intervient"},{inline:!1,label:'Nathaniel "Nathan" Wingate Peaslee',permalink:"/ArchiveLeDernierVerre/docs/tags/Nathan",description:'Archives o\xf9 Nathaniel "Nathan" Wingate Peaslee intervient'}],version:"current",frontMatter:{title:"2022-12-31 - Table (Feyre, Nathan)",toc_min_heading_level:4,toc_max_heading_level:4,tags:["tag_FeyreArtcher","tag_Nathan"]}},u={},o=[{value:"Table - 31/12/2022",id:"table---31122022",level:3},{value:"Nathaniel &quot;Nathan&quot; Wingate Peaslee",id:"nathaniel-nathan-wingate-peaslee",level:4},{value:"Feyre Artcher",id:"feyre-artcher",level:4},{value:"Nathaniel &quot;Nathan&quot; Wingate Peaslee",id:"nathaniel-nathan-wingate-peaslee-1",level:4},{value:"Feyre Artcher",id:"feyre-artcher-1",level:4},{value:"Nathaniel &quot;Nathan&quot; Wingate Peaslee",id:"nathaniel-nathan-wingate-peaslee-2",level:4},{value:"Feyre Artcher",id:"feyre-artcher-2",level:4},{value:"Nathaniel &quot;Nathan&quot; Wingate Peaslee",id:"nathaniel-nathan-wingate-peaslee-3",level:4},{value:"Feyre Artcher",id:"feyre-artcher-3",level:4},{value:"Nathaniel &quot;Nathan&quot; Wingate Peaslee",id:"nathaniel-nathan-wingate-peaslee-4",level:4},{value:"Feyre Artcher",id:"feyre-artcher-4",level:4}];function c(e){const n={a:"a",admonition:"admonition",blockquote:"blockquote",h1:"h1",h3:"h3",h4:"h4",header:"header",hr:"hr",li:"li",p:"p",strong:"strong",ul:"ul",...(0,i.R)(),...e.components};return(0,a.jsxs)(a.Fragment,{children:[(0,a.jsx)(n.header,{children:(0,a.jsx)(n.h1,{id:"table-feyre-nathan",children:"Table (Feyre, Nathan)"})}),"\n",(0,a.jsx)(n.admonition,{title:"R\xe9ception de fin d'ann\xe9e 2022",type:"info",children:(0,a.jsx)(n.h3,{id:"table---31122022",children:"Table - 31/12/2022"})}),"\n",(0,a.jsx)(n.hr,{}),"\n",(0,a.jsxs)(n.blockquote,{children:["\n",(0,a.jsx)(n.h4,{id:"nathaniel-nathan-wingate-peaslee",children:'Nathaniel "Nathan" Wingate Peaslee'}),"\n",(0,a.jsxs)(n.blockquote,{children:["\n",(0,a.jsx)(n.p,{children:"31-12-2022 23:35:07"}),"\n"]}),"\n"]}),"\n",(0,a.jsx)(n.p,{children:(0,a.jsx)(n.strong,{children:"La soir\xe9e bats son plein. J'ai crois\xe9 pas mal de beau monde, m'arr\xeatant principalement aupr\xe8s du personnel avec qui je travaille \xe0 quelques exception pr\xe8s. J'ai m\xeame pu faire quelques pas de danse, bien qu'avec ma canne on soit plus proche de la danse des canard que d'une valse. Ma jambe ayant fatigu\xe9, je me suis install\xe9 \xe0 une table avec une assiette de petit four et un verre de champagne."})}),"\n",(0,a.jsx)(n.p,{children:(0,a.jsx)(n.strong,{children:"Je me retrouve donc \xe0 une table, jambe tendu, remuant l\xe9g\xe8rement au rythme de la musique, le regard flottant dans la foule \xe0 la recherche de visages amicaux, ou du moins de gens que je connaisse."})}),"\n",(0,a.jsx)(n.hr,{}),"\n",(0,a.jsxs)(n.blockquote,{children:["\n",(0,a.jsx)(n.h4,{id:"feyre-artcher",children:"Feyre Artcher"}),"\n",(0,a.jsxs)(n.blockquote,{children:["\n",(0,a.jsx)(n.p,{children:"31-12-2022 23:45:50"}),"\n"]}),"\n"]}),"\n",(0,a.jsx)(n.p,{children:(0,a.jsx)(n.strong,{children:"J'ai chercher Nathan pendant ce qui me semble \xeatre une \xe9ternit\xe9, et pourtant, cela ne doit faire qu'\xe0 peut pr\xe8s une heure. Je d\xe9cide rapidement de refaire un tour de chaque pi\xe8ce, commen\xe7ant par les jardins puis le buffet et terminant par la piece avec toutes les tables.\r\nJe finis par envie le trouver, assis \xe0 une table. J'aurai d\xfb y penser avant, avec sa jambe, il a sans doute eut besoin de se reposer un peu.\r\nD'un pas rapidement, je me dirige vers lui en bousculant quelque personnes au passage. Une fois \xe0 sa hauteur, je ne perds pas de temps et lui par directement de ce pourquoi j'ai pass\xe9 presque deux heures \xe0 le chercher. Je prends \xe0 peine le temps de respirer et prends la parole en me plantant devant lui."})}),"\n",(0,a.jsxs)(n.blockquote,{children:["\n",(0,a.jsx)(n.p,{children:"Nathan, mon dieu !! Je te cherche depuis tout \xe0 l'heure, j'ai besoin de toi, c'est urgent !"}),"\n"]}),"\n",(0,a.jsx)(n.hr,{}),"\n",(0,a.jsxs)(n.blockquote,{children:["\n",(0,a.jsx)(n.h4,{id:"nathaniel-nathan-wingate-peaslee-1",children:'Nathaniel "Nathan" Wingate Peaslee'}),"\n",(0,a.jsxs)(n.blockquote,{children:["\n",(0,a.jsx)(n.p,{children:"31-12-2022 23:55:17"}),"\n"]}),"\n"]}),"\n",(0,a.jsx)(n.p,{children:(0,a.jsx)(n.strong,{children:"Alors que je grignote en laissant ma jambe tendue pour qu'elle se repose, je vois une furie d\xe9barquer en panique. Feyre apparait au milieu de la foule et d\xe8s qu'elle croise mon regard, elle me fond dessus comme la mis\xe8re sur le pauvre monde. Elle est rouge, essouffl\xe9e et me dit qu'elle a besoin de moi rapidement. Je la regarde de bas en haut, l'air \xe9tonn\xe9"})}),"\n",(0,a.jsxs)(n.ul,{children:["\n",(0,a.jsx)(n.li,{children:"Feyre ? Mais... Mais tu as chang\xe9 de robe, comment ? Qu'est-ce qu'il y a ? Calme toi, la soir\xe9e n'est pas termin\xe9e"}),"\n"]}),"\n",(0,a.jsx)(n.hr,{}),"\n",(0,a.jsxs)(n.blockquote,{children:["\n",(0,a.jsx)(n.h4,{id:"feyre-artcher-1",children:"Feyre Artcher"}),"\n",(0,a.jsxs)(n.blockquote,{children:["\n",(0,a.jsx)(n.p,{children:"01-01-2023 00:02:45"}),"\n"]}),"\n"]}),"\n",(0,a.jsxs)(n.blockquote,{children:["\n",(0,a.jsx)(n.p,{children:"Oui je - j'avais une robe de secours au cas ou. On m'a renverser un plateau de champagne dessus mais ce n'est pas le sujet."}),"\n"]}),"\n",(0,a.jsx)(n.p,{children:(0,a.jsx)(n.strong,{children:"Je prends quelque instant pour respirer, reprendre mon souffle. Je ne m'assois pas pour autant parce que ce n'est pas le moment de me poser. Je pose une main sur l'\xe9paule de Nathan et reprends rapidement."})}),"\n",(0,a.jsxs)(n.blockquote,{children:["\n",(0,a.jsx)(n.p,{children:"Je.. j'ai parler avec ton patron, William Dyers ! J'ai besoin de toi. Si je retourne le voir avec toi pour confirmer certaines choses, il me lib\xe9rera de mon statut d'esclave ! Mais je dois le retrouver avant la fin de la soir\xe9e et lui parler avec et seulement avec toi. Tu te rends compte, c'est la seule occasion que je vais avoir pour..pour.."}),"\n"]}),"\n",(0,a.jsx)(n.hr,{}),"\n",(0,a.jsxs)(n.blockquote,{children:["\n",(0,a.jsx)(n.h4,{id:"nathaniel-nathan-wingate-peaslee-2",children:'Nathaniel "Nathan" Wingate Peaslee'}),"\n",(0,a.jsxs)(n.blockquote,{children:["\n",(0,a.jsx)(n.p,{children:"01-01-2023 00:21:01"}),"\n"]}),"\n"]}),"\n",(0,a.jsx)(n.p,{children:(0,a.jsx)(n.strong,{children:"Feyre a l'air d'\xeatre dans un \xe9tat de panique mais en m\xeame temps, assez rassur\xe9e de m'avoir trouv\xe9. Elle exp\xe9die ma question concernant sa robe et viens s'asseoir pr\xe8s de moi pour m'expliquer la raison de tant d'empressement. Je l'\xe9coute en clignant des yeux car elle parle r\xe9ellement vite mais je comprend globalement l'id\xe9e."})}),"\n",(0,a.jsxs)(n.ul,{children:["\n",(0,a.jsx)(n.li,{children:"Attends, quoi ? Tu veux que je te suive pour rejoindre William pour que tu ne sois plus esclave ? Attends, mais \xe7a ne marche pas comme \xe7a. Enfin ce n'est pas si simple."}),"\n"]}),"\n",(0,a.jsx)(n.hr,{}),"\n",(0,a.jsxs)(n.blockquote,{children:["\n",(0,a.jsx)(n.h4,{id:"feyre-artcher-2",children:"Feyre Artcher"}),"\n",(0,a.jsxs)(n.blockquote,{children:["\n",(0,a.jsx)(n.p,{children:"01-01-2023 00:26:56"}),"\n"]}),"\n"]}),"\n",(0,a.jsxs)(n.blockquote,{children:["\n",(0,a.jsx)(n.p,{children:"C'est \xe7a, si tu viens lui parler avec moi pour confirmer certains points que l'on \xe0 abord\xe9, il m'a dit qu'il me lib\xe9rerai ! \xc7a ne marche peut \xeatre pas comme \xe7a mais il a parler de gr\xe2ce accorder et.. d'un genre cadeau de No\xebl pour toi.. Je ne sais pas si tout cela c'est simplement pour le faire tourner en bourrique, mais si il dit vrai, je ne peux pas manquer cette opportunit\xe9. Viens avec moi s'il te pla\xeet.."}),"\n"]}),"\n",(0,a.jsx)(n.p,{children:(0,a.jsx)(n.strong,{children:"Il m'\xe9coute attentivement, puis me r\xe9pond pour que je confirme en quelque sorte ce que je viens de dire. J'esp\xe8re vraiment qu'il va me suivre parce que je ne sais pas combien de temps il me reste, et si William quitte le balcon, je mettrai encore plus de temps \xe0 le retrouver."})}),"\n",(0,a.jsx)(n.hr,{}),"\n",(0,a.jsxs)(n.blockquote,{children:["\n",(0,a.jsx)(n.h4,{id:"nathaniel-nathan-wingate-peaslee-3",children:'Nathaniel "Nathan" Wingate Peaslee'}),"\n",(0,a.jsxs)(n.blockquote,{children:["\n",(0,a.jsx)(n.p,{children:"01-01-2023 00:39:05"}),"\n"]}),"\n"]}),"\n",(0,a.jsx)(n.p,{children:(0,a.jsx)(n.strong,{children:"Vu sa mani\xe8re de r\xe9pondre et de tr\xe9pigner d'impatience, cela ne ressemble pas \xe0 une blague ou une mauvaise compr\xe9hension. Pourtant, je connais William depuis assez longtemps et s'il est bien en mesure de lib\xe9rer un esclave, j'ai du mal \xe0 le penser aussi g\xe9n\xe9reux sans rien attendre en retour."})}),"\n",(0,a.jsxs)(n.ul,{children:["\n",(0,a.jsx)(n.li,{children:"Attends mais c'est tellement bizarre. Ca fait tr\xe8s longtemps que je travaille au Dernier Verre et je ne l'ai jamais vu utiliser ce genre de passe droit. Enfin si \xe7a peut t'aider, je te suis."}),"\n"]}),"\n",(0,a.jsx)(n.p,{children:(0,a.jsx)(n.strong,{children:"En m'aidant de ma canne, je me rel\xe8ve de ma place en oubliant verre et plateau de petits fours sur place. Je regarde Feyre se lever et la retiens par l'\xe9paule."})}),"\n",(0,a.jsxs)(n.ul,{children:["\n",(0,a.jsx)(n.li,{children:"Tu es bien s\xfbr de toi ? Si jamais tu dis vrai, tu ne serais plus esclave, c'est pas le genre de chose o\xf9 tu pourra revenir en arri\xe8re."}),"\n"]}),"\n",(0,a.jsx)(n.hr,{}),"\n",(0,a.jsxs)(n.blockquote,{children:["\n",(0,a.jsx)(n.h4,{id:"feyre-artcher-3",children:"Feyre Artcher"}),"\n",(0,a.jsxs)(n.blockquote,{children:["\n",(0,a.jsx)(n.p,{children:"01-01-2023 00:48:55"}),"\n"]}),"\n"]}),"\n",(0,a.jsxs)(n.blockquote,{children:["\n",(0,a.jsx)(n.p,{children:"Tu..tu penses qu'il se joue de moi ? Il avait de.. de vouloir faire \"une bonne action\".. enfin je ne le connais pas aussi bien que toi, mais je crois qu'il \xe9tait sinc\xe8re.."}),"\n"]}),"\n",(0,a.jsx)(n.p,{children:(0,a.jsx)(n.strong,{children:"Je me l\xe8ve doucement et attends que Nathan fasse de m\xeame en s'aidant de sa canne, laissant tout ce qu'il avait avec lui, petits fours et boisson, sur place. Je m'appr\xeate \xe0 partir pour retrouver William lorsqu'il me retiens par l'\xe9paule."})}),"\n",(0,a.jsxs)(n.blockquote,{children:["\n",(0,a.jsx)(n.p,{children:"Je suis s\xfbre \xe0 cent pour cent Nathan.. je ne veux plus \xeatre une esclave, j'en ai d\xe9j\xe0 assez souffert. Et je dois me lib\xe9rer de ce statut si je veux pouvoir vivre ma vie comme je l'entends. Par exemple, je pr\xe9f\xe8re \xeatre libre si je finis par avoir des enfants.. parce que entant qu'esclave, je pourrai me voir retirer mes droits sur eux et \xe7a ce serai hors de question.\r\nAlors oui Nathan, je suis s\xfbre de moi."}),"\n"]}),"\n",(0,a.jsx)(n.hr,{}),"\n",(0,a.jsxs)(n.blockquote,{children:["\n",(0,a.jsx)(n.h4,{id:"nathaniel-nathan-wingate-peaslee-4",children:'Nathaniel "Nathan" Wingate Peaslee'}),"\n",(0,a.jsxs)(n.blockquote,{children:["\n",(0,a.jsx)(n.p,{children:"01-01-2023 01:04:58"}),"\n"]}),"\n"]}),"\n",(0,a.jsx)(n.p,{children:(0,a.jsx)(n.strong,{children:"Feyre me regarde et se montre tr\xe8s s\xfbr d'elle. M\xeame dans son regard, elle fait montre d'une d\xe9termination que je ne lui ai jamais vu. Elle ne souhaites pas rester avec un tel statut et je le comprends. Apr\xe8s tout, depuis que je la connais, elle fait tout pour chercher \xe0 retrouver sa libert\xe9. M\xeame si cela veut aussi dire lui permettre de partir et ne jamais revenir. D'un autre sens, elle est ce qui se rapproche le plus d'une amie dans cette ville et si je peux bien l'aider, c'est maintenant. J'approuve donc simplement de la t\xeate en la relachant"})}),"\n",(0,a.jsxs)(n.ul,{children:["\n",(0,a.jsx)(n.li,{children:"Tr\xe8s bien, je te suis."}),"\n"]}),"\n",(0,a.jsx)(n.hr,{}),"\n",(0,a.jsxs)(n.blockquote,{children:["\n",(0,a.jsx)(n.h4,{id:"feyre-artcher-4",children:"Feyre Artcher"}),"\n",(0,a.jsxs)(n.blockquote,{children:["\n",(0,a.jsx)(n.p,{children:"01-01-2023 01:14:49"}),"\n"]}),"\n"]}),"\n",(0,a.jsxs)(n.blockquote,{children:["\n",(0,a.jsx)(n.p,{children:"Merci Nathan.."}),"\n"]}),"\n",(0,a.jsx)(n.p,{children:(0,a.jsx)(n.strong,{children:"Je lui d\xe9cerne un sourire. Et au fond de moi, je me promet de lui rendre comme je le pourrai l'appareil un jour.\r\nD\xe9cid\xe9, je reprends la direction du balcon pour y retrouver William. Sur le chemin, je fais attention \xe0 ce que Nathan arrive \xe0 suivre sans \xeatre s\xe9par\xe9 par la foule. En m\xeame temps, je r\xe9fl\xe9chis \xe0 ce qu'il pourrai de produire dans quelque instant, et au fond de moi, j'esp\xe8re que Nathan \xe0 tort et que William n'a pas une autre id\xe9e derri\xe8re la t\xeate."})}),"\n",(0,a.jsx)(n.hr,{}),"\n",(0,a.jsxs)(n.p,{children:["La suite : ",(0,a.jsx)(n.a,{href:"/ArchiveLeDernierVerre/docs/Archives/Events/ReceptionFinAnnee2022/Balcon1_Feyre_Nathan_Sera_William",children:"Feyre, Nathan, Sera, William"})]})]})}function d(e={}){const{wrapper:n}={...(0,i.R)(),...e.components};return n?(0,a.jsx)(n,{...e,children:(0,a.jsx)(c,{...e})}):c(e)}},28453:(e,n,r)=>{r.d(n,{R:()=>s,x:()=>l});var a=r(96540);const i={},t=a.createContext(i);function s(e){const n=a.useContext(t);return a.useMemo((function(){return"function"==typeof e?e(n):{...n,...e}}),[n,e])}function l(e){let n;return n=e.disableParentContext?"function"==typeof e.components?e.components(i):e.components||i:s(e.components),a.createElement(t.Provider,{value:n},e.children)}}}]);